import { useState, useEffect } from "react";
import axios from "axios";

//a siderbar initially a button when clicked shows the sidebar
//the sidebar has 3 buttons

export default function Sidebar() {

    return (
        <div className="sidebar">
            <div className="sidebar__left">
                <div className="sidebar__left__button">
                    <button className="sidebar__left__button__button">Single Trip</button>
                </div>
                <div className="sidebar__left__button">
                    <button className="sidebar__left__button__button">Multi Trip</button>
                </div>
                <div className="sidebar__left__button">
                    <button className="sidebar__left__button__button">Logout</button>
                </div>
            </div>
        </div>
    );
}
